import { AppBar, Container, Toolbar, Typography } from '@material-ui/core';
import React from 'react'

export const Header = () => {
  return (
    <AppBar color='transparent' position='static'>
      <Container>
        <Toolbar>
          <Typography>
            Crypto Tracker
          </Typography>
        </Toolbar>
      </Container>
    </AppBar>
  );
}
